import React, { useState } from'react';
import './App.css';
import Form from './Components/Form';
import SkillsList from './Components/SkillsList';


function App() {
  // State stuff
  const [inputText, setInputText] = useState("");
  const [skills, setSkills] = useState([]);
  const [logins, setLogins] = useState({});

  // Functions
  function updateLogins(e) {
    setLogins({...logins, [e.target.name]:e.target.value})
  }

  function submitHandler() {
    console.log(logins)
  }

  return (
    <div className="App">
      <nav>
          <input onChange={updateLogins} name="username" placeholder="User Name">
          </input>
          <input onChange={updateLogins} name="password" placeholder="Password">
          </input>
          <button onClick={submitHandler}>Login</button>
        </nav>
      <div className='app-container'>
        <h1 className='app-name'>Level Up App</h1>
        <Form 
          inputText={inputText}
          setInputText={setInputText}
          skills={skills}
          setSkills={setSkills}
        />

        <SkillsList
          skills={skills}
          setSkills={setSkills}
        />
      </div>

    </div>
  );
}

export default App;
